import React, { useEffect, useState } from 'react';

const MyComponent = () => {
  const [data, setData] = useState([]);
  const [isLoading, setIsLoading] = useState(true);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await fetch("http://localhost:8080/recommendation/googleImages?q=mens");
        
        if (response.ok) {
          const jsonData = await response.json();
          setData(jsonData);
          setIsLoading(false);
        } else {
          console.log('Error:', response.status);
          setIsLoading(false);
        }
      } catch (error) {
        console.error('Error occurred:', error);
        setIsLoading(false);
      }
    };

    fetchData();
  }, []);

  return (
    <div>
      {isLoading ? (
        <p>Loading...</p>
      ) : (
        <ul>
          {data.map((item) => (
            <li>{item}</li>
          ))}
        </ul>
      )}
    </div>
  );
};

export default MyComponent;
